const TamilNaduMapWithCard = () => {
  const [selectedDistrict, setSelectedDistrict] = useState(null);
  const [tooltipContent, setTooltipContent] = useState("");
  const [tooltipStyle, setTooltipStyle] = useState({ display: "none" });

  const handleChange = (event) => {
    const districtName = event.target.attributes.name.value;
    const districtData = tamilNaduMap.locations.find(
      (location) => location.name === districtName
    );
    setSelectedDistrict(districtData);
  };

  const handleLocationMouseOver = (event) => {
    const districtName = event.target.attributes.name.value;
    const districtData = tamilNaduMap.locations.find(
      (location) => location.name === districtName
    );
    setTooltipContent(
      `${districtData.name}: ${districtData.pendingCases} pending cases`
    );
    setTooltipStyle({
      display: "block",
      top: `${event.clientY - 50}px`,
      left: `${event.clientX - 50}px`,
    });
  };

  const handleLocationMouseOut = () => {
    setTooltipStyle({ display: "none" });
  };

  const getLocationClassName = (location) => {
    return `district-${location.id}`;
  };

  return (
    <Box sx={{ display: "flex" }}>
      <Grid  item xs={12} sm={12}lg={6} xl={6} style={{ flex: 1, position: "relative" }}>
        <SVGMap
          map={tamilNaduMap}
          onLocationClick={handleChange}
          onLocationMouseOver={handleLocationMouseOver}
          onLocationMouseOut={handleLocationMouseOut}
          locationClassName={getLocationClassName}
        />
        <Grid className="tooltip" style={tooltipStyle} item xs={12} sm={12}lg={6} xl={6} >
          {tooltipContent}
        </Grid>
      </Grid>
      <Grid style={{ flex: 1, padding: "20px", boxSizing: "border-box" }} item xs={12} sm={12}lg={6} xl={6}>
        <GradientCard selectedDistrict={selectedDistrict} />
      </Grid>
    </Box>
  );
};

export default TamilNaduMapWithCard;
